import React from 'react';

const MainContent = ({ module }) => {
    return (
        <main className="main-content">
            <div className="content-header">
                <h1>{module.charAt(0).toUpperCase() + module.slice(1)}</h1>
            </div>
            <div className="content-body">
                <p>Hier werden die Inhalte für das Modul "{module}" angezeigt.</p>
                {/* Hier können später die spezifischen Komponenten für jedes Modul geladen werden */}
            </div>
        </main>
    );
};

export default MainContent;
